import React, {useContext} from 'react';
import Context from '../store/context';
import Table from 'react-bootstrap/Table';
import CheckoutTitle from '../Images/CheckoutTitle.png';
import { Button, FormGroup, Label, Input, FormText, Container, Form } from 'reactstrap';

import "bootstrap/dist/css/bootstrap.css";
import UserContext from '../store/context';
import LinkContainer from 'react-router-bootstrap';
// import { Navbar, Nav, NavDropdown, Button } from 'react-bootstrap';
import { Link, useHistory } from 'react-router-dom';
import Checkout from '../Pages/Checkout';

function ShoppingCart () {
    const context = useContext(UserContext);
    return (
        <div className="custom-text">
            <h1><img id="prices-title" src={CheckoutTitle} alt="Prices"></img></h1>

            <Table striped bordered hover variant="none" id="prices-table">
                <thead>
                    <tr style={{fontSize: "larger"}}>
                        <th>Number of Items</th>
                        <th>Total Price</th>
                    </tr>
                    <tr style={{fontSize: "larger"}}>
                        {/* <td>{context.cart.length}</td> */}
                        <td>
                            <ul style={{listStyle: "none", paddingLeft: "0"}}>
                                {
                                    context.cart.map( (item) => {
                                        return (
                                            <li>{item.name} - {item.quantity}</li>
                                        )
                                    })
                                }
                            </ul>
                        </td>
                        <td>{context.cartTotal}</td>
                    </tr>
                </thead>
            </Table>

            <Form id="checkout-form">
                <h4>Enter Information Below</h4>
                <br></br>
                <FormGroup>
                    <Label for="exampleName"><h4>First and Last Name</h4></Label>
                    <Input type="name" name="name" id="exampleName" placeholder="John Doe" />
                </FormGroup>
                <FormGroup>
                    <Label for="exampleEmail"><h4>Email</h4></Label>
                    <Input type="email" name="email" id="exampleEmail" placeholder="na@example.com" />
                </FormGroup>
                <FormGroup tag="fieldset">
                    <legend><h4>Reason for Contact</h4></legend>
                    <FormGroup check>
                    <Label check>
                        <Input type="radio" name="radio1" />{' '}
                        Specific request
                    </Label>
                    </FormGroup>
                    <FormGroup check>
                    <Label check>
                        <Input type="radio" name="radio2" />{' '}
                        Problem with my order
                    </Label>
                    </FormGroup>
                    <FormGroup check>
                    <Label check>
                        <Input type="radio" name="radio3" />{' '}
                        Just wanted to say hi :)
                    </Label>
                    </FormGroup>
                    <FormGroup check>
                    <Label check>
                        <Input type="radio" name="radio4" />{' '}
                        Other
                    </Label>
                    </FormGroup>
                </FormGroup>
                <FormGroup>
                    <Label for="exampleText"><h4>Message</h4></Label>
                    <Input type="textarea" name="text" id="exampleText" />
                </FormGroup>
                <Button>Submit</Button>
            </Form>

        </div>
    );
}

export default ShoppingCart;
